using System.Threading;
using System.Configuration;
using System.Collections.ObjectModel;

using Microsoft.Azure.Management.DataFactories;
using Microsoft.Azure.Management.DataFactories.Models;
using Microsoft.Azure.Management.DataFactories.Common.Models;

using Microsoft.IdentityModel.Clients.ActiveDirectory;
using Microsoft.Azure;

// create data factory management client
string resourceGroupName = "resourcegroupname";
string dataFactoryName = "APITutorialFactorySP";

TokenCloudCredentials aadTokenCredentials =
    new TokenCloudCredentials(
        ConfigurationManager.AppSettings["SubscriptionId"],
        GetAuthorizationHeader());

Uri resourceManagerUri = new Uri(ConfigurationManager.AppSettings["ResourceManagerEndpoint"]);

DataFactoryManagementClient client = new DataFactoryManagementClient(aadTokenCredentials, resourceManagerUri);

// create a data factory
Console.WriteLine("Creating a data factory");
client.DataFactories.CreateOrUpdate(resourceGroupName,
    new DataFactoryCreateOrUpdateParameters()
    {
        DataFactory = new DataFactory()
        {
            Name = dataFactoryName,
            Location = "westus",
            Properties = new DataFactoryProperties() { }
        }
    }
);

// create a linked service
Console.WriteLine("Creating a linked service");
client.LinkedServices.CreateOrUpdate(resourceGroupName, dataFactoryName,
    new LinkedServiceCreateOrUpdateParameters()
    {
        LinkedService = new LinkedService()
        {
            Name = "LinkedService-AzureStorage",
            Properties = new LinkedServiceProperties
            (
                new AzureStorageLinkedService("DefaultEndpointsProtocol=https;AccountName=<account name>;AccountKey=<account key>")
            )
        }
    }
);

// create input and output tables
Console.WriteLine("Creating input and output tables");
string Table_Source = "TableBlobSource";
string Table_Destination = "TableBlobDestination";

client.Tables.CreateOrUpdate(resourceGroupName, dataFactoryName,
    new TableCreateOrUpdateParameters()
    {
        Table = new Table()
        {
            Name = Table_Source,
            Properties = new TableProperties()
            {
                LinkedServiceName = "LinkedService-AzureStorage",
                TypeProperties = new AzureBlobDataset()
                {
                    FolderPath = "adftutorial/",
                    FileName = "emp.txt"
                },
                External = true,
                Availability = new Availability()
                {
                    Frequency = SchedulePeriod.Hour,
                    Interval = 1,
                },

                Policy = new Policy()
                {
                    Validation = new ValidationPolicy()
                    {
                        MinimumRows = 1
                    }
                }
            }
        }
    });

client.Tables.CreateOrUpdate(resourceGroupName, dataFactoryName,
    new TableCreateOrUpdateParameters()
    {
        Table = new Table()
        {
            Name = Table_Destination,
            Properties = new TableProperties()
            {

                LinkedServiceName = "LinkedService-AzureStorage",
                TypeProperties = new AzureBlobDataset()
                {
                    FolderPath = "adftutorial/apifactoryoutput/{Slice}",
                    PartitionedBy = new Collection<Partition>()
                    {
                        new Partition()
                        {
                            Name = "Slice",
                            Value = new DateTimePartitionValue()
                            {
                                Date = "SliceStart",
                                Format = "yyyyMMdd-HH"
                            }
                        }
                    }
                },

                Availability = new Availability()
                {
                    Frequency = SchedulePeriod.Hour,
                    Interval = 1,
                },
            }
        }
    });

    // create a pipeline
Console.WriteLine("Creating a pipeline");
DateTime PipelineActivePeriodStartTime = new DateTime(2014, 8, 9, 0, 0, 0, 0, DateTimeKind.Utc);
DateTime PipelineActivePeriodEndTime = PipelineActivePeriodStartTime.AddMinutes(60);
string PipelineName = "PipelineBlobSample";

client.Pipelines.CreateOrUpdate(resourceGroupName, dataFactoryName,
    new PipelineCreateOrUpdateParameters()
    {
        Pipeline = new Pipeline()
        {
            Name = PipelineName,
            Properties = new PipelineProperties()
            {
                Description = "Demo Pipeline for data transfer between blobs",

                // Initial value for pipeline's active period. With this, you won't need to set slice status
                Start = PipelineActivePeriodStartTime,
                End = PipelineActivePeriodEndTime,

                Activities = new List<Activity>()
                {                                
                    new Activity()
                    {   
                        Name = "BlobToBlob",
                        Inputs = new List<ActivityInput>()
                        {
                            new ActivityInput() {
                                Name = Table_Source
                            }
                        },
                        Outputs = new List<ActivityOutput>()
                        {
                            new ActivityOutput()
                            {
                                Name = Table_Destination
                            }
                        },
                        TypeProperties = new CopyActivity()
                        {
                            Source = new BlobSource(),
                            Sink = new BlobSink()
                            {
                                WriteBatchSize = 10000,
                                WriteBatchTimeout = TimeSpan.FromMinutes(10)
                            }
                        }
                    }

                },
            }
        }
    });

public static string GetAuthorizationHeader()
{
    AuthenticationResult result = null;
    var thread = new Thread(() =>
    {
        try
        {
            var context = new AuthenticationContext(ConfigurationManager.AppSettings["ActiveDirectoryEndpoint"] + ConfigurationManager.AppSettings["ActiveDirectoryTenantId"]);

            result = context.AcquireToken(
                resource: ConfigurationManager.AppSettings["WindowsManagementUri"],
                clientId: ConfigurationManager.AppSettings["AdfClientId"],
                redirectUri: new Uri(ConfigurationManager.AppSettings["RedirectUri"]),
                promptBehavior: PromptBehavior.Always);
        }
        catch (Exception threadEx)
        {
            Console.WriteLine(threadEx.Message);
        }
    });

    thread.SetApartmentState(ApartmentState.STA);
    thread.Name = "AcquireTokenThread";
    thread.Start();
    thread.Join();

    if (result != null)
    {
        return result.AccessToken;
    }

    throw new InvalidOperationException("Failed to acquire token");
}

// Pulling status within a timeout threshold
DateTime start = DateTime.Now;
bool done = false;

while (DateTime.Now - start < TimeSpan.FromMinutes(5) && !done)
{
    Console.WriteLine("Pulling the slice status");
    // wait before the next status check
    Thread.Sleep(1000 * 12);

    var datalistResponse = client.DataSlices.List(resourceGroupName, dataFactoryName, Table_Destination,
        new DataSliceListParameters()
        {
            DataSliceRangeStartTime = PipelineActivePeriodStartTime.ConvertToISO8601DateTimeString(),
            DataSliceRangeEndTime = PipelineActivePeriodEndTime.ConvertToISO8601DateTimeString()
        });

    foreach (DataSlice slice in datalistResponse.DataSlices)
    {
        if (slice.State == DataSliceState.Failed || slice.State == DataSliceState.Ready)
        {
            Console.WriteLine("Slice execution is done with status: {0}", slice.State);
            done = true;
            break;
        }
        else
        {
            Console.WriteLine("Slice status is: {0}", slice.State);
        }
    }
}

Console.WriteLine("Getting run details of a data slice");

// give it a few minutes for the output slice to be ready
Console.WriteLine("\nGive it a few minutes for the output slice to be ready and press any key.");
Console.ReadKey();

var datasliceRunListResponse = client.DataSliceRuns.List(
        resourceGroupName,
        dataFactoryName,
        Table_Destination,
        new DataSliceRunListParameters()
        {
            DataSliceStartTime = PipelineActivePeriodStartTime.ConvertToISO8601DateTimeString()
        }
    );

foreach (DataSliceRun run in datasliceRunListResponse.DataSliceRuns)
{
    Console.WriteLine("Status: \t\t{0}", run.Status);
    Console.WriteLine("DataSliceStart: \t{0}", run.DataSliceStart);
    Console.WriteLine("DataSliceEnd: \t\t{0}", run.DataSliceEnd);
    Console.WriteLine("ActivityId: \t\t{0}", run.ActivityName);
    Console.WriteLine("ProcessingStartTime: \t{0}", run.ProcessingStartTime);
    Console.WriteLine("ProcessingEndTime: \t{0}", run.ProcessingEndTime);
    Console.WriteLine("ErrorMessage: \t{0}", run.ErrorMessage);
}

Console.WriteLine("\nPress any key to exit.");
Console.ReadKey();
